import React from 'react'
import Game from './Game'

export default function GameGenre({gamesGenre}) {
    return (
        <div>
         {gamesGenre.map(gameGenre => (
              <Game gamesGenre={gameGenre.genre} />
         ))}
        </div>
    )
}
